import React from 'react'

class MobileApp extends React.Component {
  render() {
    return (
      <React.Fragment>
        <header>
          <h1> Sawasdee Thai Cuisine </h1>
        </header>
      </React.Fragment>
    )
  }
}
export default MobileApp

